import React from 'react';
import Canvas from './Canvas';

const Ball = () => {
  const draw = (ctx, stageWidth, stageHeight) => {
    ctx.clearRect(0, 0, stageWidth, stageHeight);
    ctx.beginPath();
    ctx.arc()
  }

  return <Canvas draw={draw} />
}

export default Ball;
